import React, {useState} from 'react';
import {Pressable, StyleSheet, Text, View} from 'react-native';
import {NavigationContainer} from '@react-navigation/native';
import {createNativeStackNavigator} from '@react-navigation/native-stack';
import { ScreenStack } from 'react-native-screens';

var timepressed = 0;
const Stack = createNativeStackNavigator();

const navitgatorScreen = (navigation) => {
return(

  
  <View style={{ flex: 1, flexDirection: 'column', alignItems: 'center', justifyContent: 'center', margin: '10', padding: '20'}}>
   <Text style={styles.text}>Testing</Text>
</View>

);
}

const Button1 = () => {
 const [timesPressed, setTimesPressed] = useState(0);//Don't delete.

  return (
   

    <View style={styles.container}>

    
      <Pressable
        onPress={() => {
          setTimesPressed(current => current + 1);//Don't delete. The counting system stops working if this line isn't here
          timepressed=timepressed + 1;
        }}
        style={({pressed}) => [
          {
            backgroundColor: pressed ? 'rgb(10, 100, 25)' : 'white',
          },
          styles.wrapperCustom,
        ]}>
        {({pressed}) => (
          <Text style={styles.text}>{pressed ? 'was pressed!' : 'Press Me'}</Text>
        )}
      </Pressable>
      <View style={styles.logBox}>
        <Text>This is pressed {timepressed}</Text>
      </View>
    </View>
  );
};



//export default navitgatorScreen;
export {Button1,navitgatorScreen};



  const styles = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#33BEFF',
      alignItems: 'center',
      justifyContent: 'center',
    },
    button: {
      alignItems: 'center',
      justifyContent: 'center',
      flexDirection: 'row',
      paddingVertical: 30,
      paddingHorizontal: 50,
      margin: 4,
      borderRadius: 4,
      elevation: 3,
      backgroundColor: 'red',
    },
    text: {
      fontSize: 22,
      lineHeight: 21,
      fontWeight: 'bold',
      letterSpacing: 1.5,
      color: 'white',
    },
    wrapperCustom: {
      borderRadius: 8,
      padding: 6,
    },
    logBox: {
      padding: 20,
      margin: 10,
      borderWidth: StyleSheet.hairlineWidth,
      borderColor: '#f0f0f0',
      backgroundColor: '#f9f9f9',
    },
  
  })
